import org.apache.commons.lang.RandomStringUtils; 
import com.eviware.soapui.support.types.StringToStringMap;  

import groovy.json.JsonSlurper; 
import java.util.Date;   

def tc = context.testCase.testSuite.project.testSuites['Digisurvey-Regression'].testCases['Setup']  
def response = tc.getTestStepByName("TokenRequest").getProperty("Response").getValue();

def slurper = new JsonSlurper() 
def jsonResponse = slurper.parseText response;  

TokenValue = jsonResponse.access_token 
Token= 'Bearer ' + ' ' + TokenValue 

if (Token==null){
	log.info("FAIL . Did not find access token")
} else {
	log.info("SUCCESS . Set token")
	context.testCase.testSuite.project.setPropertyValue("Token",Token);
}  

CompanyID = jsonResponse.CompanyId
if (CompanyID==null){
	log.info("FAIL . Did not find Company ID")
} else {
	log.info("SUCCESS . Set Company ID")
	context.testCase.testSuite.project.setPropertyValue("CompanyId",CompanyID);
} 

UserID = jsonResponse.UserId
if (UserID==null){
	log.info("FAIL . Did not find User ID")
} else {
	log.info("SUCCESS . Set User ID")
	context.testCase.testSuite.project.setPropertyValue("UserId",UserID);
} 

RoleID = jsonResponse.RoleId
if (RoleID==null){
	log.info("FAIL . Did not find Role ID")
} else {
	log.info("SUCCESS . Set Role ID")
	context.testCase.testSuite.project.setPropertyValue("RoleId",RoleID);
}

